import React from 'react';
import "./RecipeTile.css";

export default function RecipleTile({recipe}) {
    return (

        <div className="recipeTile">
        <img className="recipeTile__img" src={recipe["strDrinkThumb"]} />
        <p className="recipeTile__name">{recipe["strDrink"]}</p>
        <p> {recipe["strIngredient1"]}</p>
        </div>

    );
}
